import React from 'react'
import {createStackNavigator} from '@react-navigation/stack'

import {Home,LandingPage} from '../components'

const MainStack = createStackNavigator({
  Login:{
    screen:"LandingPage"
  },
  Home:{
    screen:'Home'
  }
},
{
  initialRouteName:'Login'
}
)

export default MainStack
